import React from "react";
import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';
import ProfileDropdown from "./ProfileDropdown";
import "../styles/header-style.css";
const Header = ({ title, profileImage }) => {
  return (
    <>
      <Navbar id="custom-navbar" className="d-flex justify-content-center align-items-start ">
      <Container className="d-flex justify-content-between w-100" >
        <Navbar.Brand className="text-center mx-auto" >{title}</Navbar.Brand>
        {profileImage && (
            <ProfileDropdown avatar={profileImage}/>
        )}
      </Container>
      </Navbar>
    </>
  );
};

export default Header;
